.54 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 227.52 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 58.07 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 3558.25 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.1.127:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 32 &lt;/li&gt;\n          &lt;li&gt; Threads: 768 &lt;/li&gt;\n          &lt;li&gt; Memory: 5.40 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1236","type":"WheelZoomTool"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1408","type":"Panel"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{"axis_label":"Percentage","coordinates":null,"formatter":{"id":"1476"},"group":null,"major_label_policy":{"id":"1477"},"ticker":{"id":"1231"}},"id":"1230","type":"LinearAxis"},{"attributes":{"below":[{"id":"1226"}],"center":[{"id":"1229"},{"id":"1233"},{"id":"1247"}],"height":150,"left":[{"id":"1230"}],"renderers":[{"id":"1245"}],"sizing_mode":"stretch_both","title":{"id":"1217"},"toolbar":{"id":"1237"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1222"},"y_range":{"id":"1220"},"y_scale":{"id":"1224"}},"id":"1216","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"group":null,"render_mode":"css","source":{"id":"1214"},"text":{"field":"cpu"},"text_font_size":{"value":"1em"},"x":{"field":"x"},"x_units":"screen","y":{"field":"y"},"y_units":"screen"},"id":"1247","type":"LabelSet"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","type":"Grid"},{"attributes":{},"id":"1040","type":"DataRange1d
